import React, { useContext, useState } from 'react';
import { InventoryContext } from '../context/InventoryContext';

const ProductManagement = () => {
  const { products, addProduct, updateProduct, deleteProduct } = useContext(InventoryContext);
  const [productForm, setProductForm] = useState({
    name: '',
    description: '',
    category: '',
    price: '',
    quantity: '',
  });
  const [isEditing, setIsEditing] = useState(false);
  const [editingProductId, setEditingProductId] = useState(null); // Track the product being edited

  const handleChange = (e) => {
    const { name, value } = e.target;
    setProductForm(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (isEditing) {
      updateProduct({ id: editingProductId, ...productForm });
      setIsEditing(false); // Reset editing state
      setEditingProductId(null); // Clear editing product ID
    } else {
      const productId = new Date().getTime().toString(); // Temporary ID for demonstration
      addProduct({ id: productId, ...productForm });
    }
    setProductForm({ name: '', description: '', category: '', price: 0, quantity: 0 }); // Reset form
  };

  const handleEdit = (product) => {
    setProductForm(product);
    setIsEditing(true);
    setEditingProductId(product.id); // Set product ID for editing
  };
  const handleDelete = (id) => {
    fetch(`http://localhost:5001/api/products/${id}`, { method: 'DELETE' })
      .then(response => {
        if (response.ok) {
          setProducts(prevProducts => prevProducts.filter(product => product.id !== id));
        } else {
          console.error("Failed to delete product on backend.");
        }
      })
      .catch(error => console.error("Error in deleting product:", error));
  };

  return (
    <div>
      <h1>Product Management</h1>
      <form onSubmit={handleSubmit}>
        <input type="text" name="name" value={productForm.name} onChange={handleChange} placeholder="Product Name" required />
        <input type="text" name="description" value={productForm.description} onChange={handleChange} placeholder="Description" required />
        <input type="text" name="category" value={productForm.category} onChange={handleChange} placeholder="Category" required />
        <input type="number" name="price" value={productForm.price} onChange={handleChange} placeholder="Price" required />
        <input type="number" name="quantity" value={productForm.quantity} onChange={handleChange} placeholder="Initial Quantity" required />
        <button type="submit">{isEditing ? 'Update Product' : 'Add Product'}</button>
      </form>

      <h2>Products</h2>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Description</th>
            <th>Category</th>
            <th>Price</th>
            <th>Quantity</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {products.map(product => (
            <tr key={product.id}>
              <td>{product.name}</td>
              <td>{product.description}</td>
              <td>{product.category}</td>
              <td>M{product.price} </td>
              <td>{product.quantity}</td>
              <td>
                <button onClick={() => handleEdit(product)}>Edit</button>
                <button onClick={() => handleDelete(product.id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ProductManagement;
